JQVMap.prototype.setValues=function(c){var a=0,d=Number.MAX_VALUE,e;for(var f in c){f=f.toLowerCase();e=parseFloat(c[f]);if(isNaN(e)){continue}if(e>a){a=c[f]}if(e<d){d=e}}if(d===a){a++}this.colorScale.setMin(d);this.colorScale.setMax(a);var b={};for(f in c){f=f.toLowerCase();e=parseFloat(c[f]);b[f]=isNaN(e)?this.color:this.colorScale.getColor(e)}this.setColors(b);this.values=c};